import React from 'react'
const leftSideBar = {
    navigation: {
        name: 'Энциклопедия',
        links: [
            {
                name: 'Монстры',
                link: [
                    {
                        name: 'Monsters'
                    },
                    {
                        name: 'Monsters2'
                    },
                    {
                        name: 'Monsters3'
                    },
                ],
            },
            {
                name: 'Вещи',
                link: 'google.com',
            },
            {
                name: 'Рыбалка',
                link: 'google.com',
            },
            {
                name: 'Крафт',
                link: 'google.com',
            },
            {
                name: 'Манор',
                link: 'google.com',
            },
            {
                name: 'Питомцы',
                link: 'google.com',
            },
            {
                name: 'Классы',
                link: 'google.com',
            },
            {
                name: 'Квесты',
                link: 'google.com',
            },
        ]
    }
};
const LeftMenu = () => (
    <aside className={'leftMenu-container'}>
        {Object.values(leftSideBar).map((obj, key) =>
            <div key={key} className={'navigation'}>
                <h6>{obj.name}</h6>
                <nav>
                    {(obj.links).map((link, key) => <li key={key}><a>{link.name}</a>
                        <ul className={'subMenu'}>
                            <li key={key}>{link.link[0].name}</li>
                        </ul>
                    </li>)}
                </nav>
            </div>)}
    </aside>
);

export default LeftMenu;
